    changePassword: {
        headingText: "Change Password",
        sideScreen: {
            textLine1: "Welcome to I2pay",
        },
    },
    setNewPassword: {
        headingText: "Reset Password",
        sideScreen: {
            textLine1: "Welcome to I2pay",
        },
    },
    resetPassword: {
        headingText: "Enter new password",
        sideScreen: {
            textLine1: "Welcome to I2pay",
        },
    },
};
